import React, { useEffect, useState } from "react";
import "./App.css";

type book = {
  id: string;
  name: string;
};

function App() {
  const [result, setResult] = useState<book[]>([]);

  useEffect(() => {
    const api = async () => {
      const data = await fetch("https://the-one-api.dev/v2/book", {
        method: "GET",
      });
      const jsonData = await data.json();
      setResult(jsonData.results);
    };
    api();
  }, []);

  return (
    <div className="App">
      <h1>
        {result.map((value) => {
          return (
            <div>
              <div>{value.id}</div>
              <div>{value.name}</div>
            </div>
          );
        })}
      </h1>
    </div>
  );
}

export default App;
